import React, { useState, useEffect } from 'react';
import { Container, Grid, Paper, Typography, CircularProgress, Box, Table, TableBody, TableCell, TableContainer, TableHead, TableRow } from '@mui/material';
import { BarChart, Bar, XAxis, YAxis, CartesianGrid, Tooltip, Legend, ResponsiveContainer } from 'recharts';
import { getMISOData } from '../services/api.ts';
import { MISOResponse, MISONode } from '../types/energy';

const Dashboard: React.FC = () => {
  const [misoData, setMisoData] = useState<MISOResponse | null>(null);
  const [loading, setLoading] = useState<boolean>(true);
  const [error, setError] = useState<string | null>(null);

  useEffect(() => {
    const fetchData = async () => {
      try {
        setLoading(true);
        const data = await getMISOData();
        setMisoData(data);
        setError(null);
      } catch (err) {
        setError('Failed to fetch MISO data. Please try again later.');
        console.error(err);
      } finally {
        setLoading(false);
      }
    };

    fetchData();

    // Refresh data every 60 seconds
    const intervalId = setInterval(fetchData, 60000);

    return () => clearInterval(intervalId);
  }, []);

  if (loading && !misoData) {
    return (
      <Box display="flex" justifyContent="center" alignItems="center" minHeight="80vh">
        <CircularProgress />
      </Box>
    );
  }

  if (error && !misoData) {
    return (
      <Box display="flex" justifyContent="center" alignItems="center" minHeight="80vh">
        <Typography color="error">{error}</Typography>
      </Box>
    );
  }

  // Prepare chart data
  const chartData = misoData?.nodes.map(node => ({
    nodeName: node.node_name,
    lmp: parseFloat(node.lmp.toString()),
    mcc: parseFloat(node.mcc.toString()),
    mlc: parseFloat(node.mlc.toString()),
    mec: parseFloat(node.mec.toString()),
  })) || [];

  return (
    <Container maxWidth="lg" sx={{ mt: 4, mb: 4 }}>
      <Typography variant="h4" component="h1" gutterBottom>
        MISO Real-Time Energy Market Dashboard
      </Typography>

      {misoData && (
        <Box mb={4}>
          <Typography variant="h6" gutterBottom>
            Interval Information
          </Typography>
          <Grid container spacing={3}>
            <Grid item xs={12} sm={6} md={3}>
              <Paper sx={{ p: 2, textAlign: 'center' }}>
                <Typography variant="body2" color="text.secondary">
                  Interval ID
                </Typography>
                <Typography variant="h6">
                  {misoData.interval_id}
                </Typography>
              </Paper>
            </Grid>
            <Grid item xs={12} sm={6} md={3}>
              <Paper sx={{ p: 2, textAlign: 'center' }}>
                <Typography variant="body2" color="text.secondary">
                  Start Time
                </Typography>
                <Typography variant="h6">
                  {new Date(misoData.interval_start).toLocaleTimeString()}
                </Typography>
              </Paper>
            </Grid>
            <Grid item xs={12} sm={6} md={3}>
              <Paper sx={{ p: 2, textAlign: 'center' }}>
                <Typography variant="body2" color="text.secondary">
                  End Time
                </Typography>
                <Typography variant="h6">
                  {new Date(misoData.interval_end).toLocaleTimeString()}
                </Typography>
              </Paper>
            </Grid>
            <Grid item xs={12} sm={6} md={3}>
              <Paper sx={{ p: 2, textAlign: 'center' }}>
                <Typography variant="body2" color="text.secondary">
                  Node Count
                </Typography>
                <Typography variant="h6">
                  {misoData.node_count}
                </Typography>
              </Paper>
            </Grid>
          </Grid>
        </Box>
      )}

      <Grid container spacing={3}>
        {/* LMP Chart */}
        <Grid item xs={12} md={6}>
          <Paper sx={{ p: 2, display: 'flex', flexDirection: 'column', height: 400 }}>
            <Typography variant="h6" gutterBottom component="div">
              Locational Marginal Prices (LMP)
            </Typography>
            <ResponsiveContainer>
              <BarChart
                data={chartData.slice(0, 10)}
                margin={{ top: 5, right: 30, left: 20, bottom: 100 }}
              >
                <CartesianGrid strokeDasharray="3 3" />
                <XAxis 
                  dataKey="nodeName"
                  angle={-45}
                  textAnchor="end"
                  height={100}
                  interval={0}
                />
                <YAxis />
                <Tooltip />
                <Legend />
                <Bar dataKey="lmp" fill="#8884d8" name="LMP ($/MWh)" />
              </BarChart>
            </ResponsiveContainer>
          </Paper>
        </Grid>

        {/* MCC/MLC Chart */}
        <Grid item xs={12} md={6}>
          <Paper sx={{ p: 2, display: 'flex', flexDirection: 'column', height: 400 }}>
            <Typography variant="h6" gutterBottom component="div">
              Price Components Comparison
            </Typography>
            <ResponsiveContainer>
              <BarChart
                data={chartData.slice(0, 10)}
                margin={{ top: 5, right: 30, left: 20, bottom: 100 }}
              >
                <CartesianGrid strokeDasharray="3 3" />
                <XAxis 
                  dataKey="nodeName"
                  angle={-45}
                  textAnchor="end"
                  height={100}
                  interval={0}
                />
                <YAxis />
                <Tooltip />
                <Legend />
                <Bar dataKey="mcc" fill="#82ca9d" name="MCC ($/MWh)" />
                <Bar dataKey="mlc" fill="#ffc658" name="MLC ($/MWh)" />
                <Bar dataKey="mec" fill="#ff8042" name="MEC ($/MWh)" />
              </BarChart>
            </ResponsiveContainer>
          </Paper>
        </Grid>

        {/* Data Table */}
        <Grid item xs={12}>
          <Paper sx={{ p: 2, display: 'flex', flexDirection: 'column' }}>
            <Typography variant="h6" gutterBottom component="div">
              MISO Node Data
            </Typography>
            <TableContainer>
              <Table size="small">
                <TableHead>
                  <TableRow>
                    <TableCell>Node</TableCell>
                    <TableCell>Node Name</TableCell>
                    <TableCell align="right">LMP ($/MWh)</TableCell>
                    <TableCell align="right">MCC ($/MWh)</TableCell>
                    <TableCell align="right">MLC ($/MWh)</TableCell>
                    <TableCell align="right">MEC ($/MWh)</TableCell>
                  </TableRow>
                </TableHead>
                <TableBody>
                  {misoData?.nodes.map((node) => (
                    <TableRow key={node.id}>
                      <TableCell>{node.node}</TableCell>
                      <TableCell>{node.node_name}</TableCell>
                      <TableCell align="right">{node.lmp.toFixed(2)}</TableCell>
                      <TableCell align="right">{node.mcc.toFixed(2)}</TableCell>
                      <TableCell align="right">{node.mlc.toFixed(2)}</TableCell>
                      <TableCell align="right">{node.mec.toFixed(2)}</TableCell>
                    </TableRow>
                  ))}
                </TableBody>
              </Table>
            </TableContainer>
          </Paper>
        </Grid>
      </Grid>
    </Container>
  );
};

export default Dashboard;
